shape64563 = new ObjImage('shape64563','images/shape64563.png','Selain berkontribusi terhadap emisi karbon dioksida, pembakaran biomassa dalam keadaan padat, cair, atau gas juga dapat melepaskan polutan dan partikel lain ke udara, termasuk karbon monoksida, senyawa organik yang mudah menguap, dan nitrogen oksida. Dalam beberapa kasus, biomassa yang terbakar dapat mengeluarkan lebih banyak polusi daripada bahan bakar fosil. Tidak seperti emisi karbon dioksida, banyak dari polutan ini tidak dapat diasingkan oleh tanaman baru. Senyawa ini dapat menyebabkan sejumlah masalah lingkungan dan kesehatan manusia jika tidak diatasi dengan baik.',332,191,468.000000,229.000000,0,47,'div','',0 )

shape66452 = new ObjImage('shape66452','images/shape66452.png','Tidak semua solusi energi biomassa sama; beberapa kelemahan lingkungan dari bioenergi dapat dikurangi melalui pengelolaan hutan yang lebih berkelanjutan dan dengan membuat pilihan yang cermat tentang jenis biomassa yang kita panen untuk bahan bakar dan bagaimana kita memanennya. Menanam tanaman untuk digunakan sebagai bahan bakar biomassa juga dapat membantu mengendalikan pemanasan global. Itu karena tanaman menghilangkan karbon dioksida - salah satu gas rumah kaca - dari atmosfer saat mereka tumbuh.  Kemajuan dalam penelitian dan teknologi, dapat membantu membuat investasi masa depan dalam bioenergi lebih ramah lingkungan.',324,187,504.000000,246.000000,0,48,'div','',0 )
